/* SCROLL BAR */
/* i really want this to be global */

/* URL's to images that were converted to data URI's
          Down: http://i.imgur.com/YNqmT9k.png
   Down Active: http://i.imgur.com/hWIaNsY.png
 Down Disabled: http://i.imgur.com/b7qGKL0.png
          Left: http://i.imgur.com/cL5mFwu.png
   Left Active: http://i.imgur.com/iuucflB.png
 Left Disabled: http://i.imgur.com/ifPTTqJ.png
         Right: http://i.imgur.com/2hAKwF4.png
  Right Active: http://i.imgur.com/bqJfZnR.png
Right Disabled: http://i.imgur.com/tc5OiSR.png
            Up: http://i.imgur.com/JU9dTiB.png
     Up Active: http://i.imgur.com/NdSzXBk.png
   Up Disabled: http://i.imgur.com/1MilXmj.png
       Resizer: http://i.imgur.com/qcqpBJW.png
*/
::-webkit-scrollbar
{
  width: auto;
}
/* arrow buttons */
::-webkit-scrollbar-button {background-color: #0e0e0e;background-repeat: no-repeat;background-position: center;}
::-webkit-scrollbar-button:active {background-color: #868686;}
::-webkit-scrollbar-button:hover:not(:active) {background-color: #2c2c2c;}
::-webkit-scrollbar-button:horizontal:increment {background-image: url('data:image/png;base64,');}
::-webkit-scrollbar-button:horizontal:increment:active {background-image: url('data:image/png;base64,');}
::-webkit-scrollbar-button:horizontal:increment:disabled {background-image: url('data:image/png;base64,');}
::-webkit-scrollbar-button:horizontal:decrement {background-image: url('data:image/png;base64,');}
::-webkit-scrollbar-button:horizontal:decrement:active {background-image: url('data:image/png;base64,');}
::-webkit-scrollbar-button:horizontal:decrement:disabled {background-image: url('data:image/png;base64,');}
::-webkit-scrollbar-button:vertical:increment {background-image: url('data:image/png;base64,');}
::-webkit-scrollbar-button:vertical:increment:active {background-image: url('data:image/png;base64,');}
::-webkit-scrollbar-button:vertical:increment:disabled {background-image: url('data:image/png;base64,');}
::-webkit-scrollbar-button:vertical:decrement {background-image: url('data:image/png;base64,');}
::-webkit-scrollbar-button:vertical:decrement:active {background-image: url('data:image/png;base64,');}
::-webkit-scrollbar-button:vertical:decrement:disabled {background-image: url('data:image/png;base64,');}
/* foreground bar */
::-webkit-scrollbar-thumb
{
  background-color: #3e3e3e;
  border: none;
}
::-webkit-scrollbar-thumb:horizontal {border-top: 2px solid #0e0e0e;border-bottom: 2px solid #0e0e0e;}
::-webkit-scrollbar-thumb:vertical {border-left: 2px solid #0e0e0e;border-right: 2px solid #0e0e0e;}
::-webkit-scrollbar-thumb:active:hover
{
  background-color: #878787;
}

::-webkit-scrollbar-thumb:hover
{
  background-color: #575757;
}
/* background bar */
::-webkit-scrollbar-track
{
  background-color: #0e0e0e;
  border: none;
}
/* corner, when there is converged scrollbars */
::-webkit-scrollbar-corner
{
  background-color: #232323;
}

::-webkit-resizer
{
  border-top: 1px solid #262626;
  border-left: 1px solid #262626;
  background-image: url('data:image/png;base64,');
}

/* Firefox */
*
{
  scrollbar-color: #3d3d3d #0e0e0e;
  scrollbar-width: auto;
}
}

